$ser_content = 'a:2:{s:7:"CONTENT";s:0:"";s:4:"VARS";a:3:{i:37084;a:24:{s:2:"ID";s:5:"37084";s:11:"ACTIVE_FROM";s:15:"1 июля 2020";s:9:"IBLOCK_ID";s:2:"12";s:19:"PROPERTY_NAME_VALUE";s:13:"Галина ";s:22:"PROPERTY_NAME_VALUE_ID";s:8:"37084:21";s:20:"PROPERTY_EMAIL_VALUE";s:23:"Lushnikovaspb@yandex.ru";s:23:"PROPERTY_EMAIL_VALUE_ID";s:8:"37084:22";s:25:"PROPERTY_SPECIALIST_VALUE";s:0:"";s:28:"PROPERTY_SPECIALIST_VALUE_ID";s:8:"37084:23";s:22:"PROPERTY_MESSAGE_VALUE";a:2:{s:4:"TEXT";s:796:"Хотим с мужем выразить свою огромную благодарнось Ольге Евгеньевне за нашего сыночка! Это очень приятная и красивая женщина, чуткая, отвечающая на все вопросы и знающая свое дело. Всегда была на связи, если возникали какие-то вопросы. На каждом этапе рассказывала, что и как будет происходить, ничего лишнего, все по делу и результат не заставил долго себя ждать! Если решимся на еще одно маленькое чудо, то только к ней! Спасибо огромное!";s:4:"TYPE";s:4:"TEXT";}s:25:"PROPERTY_MESSAGE_VALUE_ID";s:8:"37084:24";s:19:"PROPERTY_FILE_VALUE";a:0:{}s:17:"PROPERTY_PD_VALUE";s:1:"1";s:20:"PROPERTY_PD_VALUE_ID";s:8:"37084:26";s:24:"PROPERTY_LAST_NAME_VALUE";s:16:"Венцевич";s:27:"PROPERTY_LAST_NAME_VALUE_ID";s:9:"37084:115";s:27:"PROPERTY_IS_MODERATED_VALUE";s:1:"1";s:30:"PROPERTY_IS_MODERATED_VALUE_ID";s:9:"37084:139";s:25:"PROPERTY_SHOW_ON_EN_VALUE";i:0;s:28:"PROPERTY_SHOW_ON_EN_VALUE_ID";s:9:"37084:612";s:25:"PROPERTY_FILE_DESCRIPTION";a:0:{}s:31:"PROPERTY_FILE_PROPERTY_VALUE_ID";a:0:{}s:10:"specialist";b:0;s:4:"file";a:0:{}}i:23506;a:24:{s:2:"ID";s:5:"23506";s:11:"ACTIVE_FROM";s:22:"12 октября 2014";s:9:"IBLOCK_ID";s:2:"12";s:19:"PROPERTY_NAME_VALUE";s:10:"Елена";s:22:"PROPERTY_NAME_VALUE_ID";s:8:"23506:21";s:20:"PROPERTY_EMAIL_VALUE";s:15:"bairov@sbor.net";s:23:"PROPERTY_EMAIL_VALUE_ID";s:8:"23506:22";s:25:"PROPERTY_SPECIALIST_VALUE";s:0:"";s:28:"PROPERTY_SPECIALIST_VALUE_ID";s:8:"23506:23";s:22:"PROPERTY_MESSAGE_VALUE";a:2:{s:4:"TEXT";s:1314:"Я пациентка 1994/1995 г., моим девчонкам в этом году исполнится 19, мы родом из вашей клиники. Открыла сайт, а тут все те же лица врачей, которые всю жизнь посвятили тому, чтобы тысячи семей сделать счастливыми. В далеком 1995  статистика была не такой обнадеживающей, только врачи внушали веру в успех. У меня было две попытки и после второй появились две девочки, долго не могла ничего им рассказать об их появлении и только сейчас, когда они стали взрослыми поговорили об этом. В 2007 году был снят документальный фильм &quot;Дети из пробирки&quot;, там я увидела и своих детей на празднике в честь рождения клиники. Тем кто приходит на этот сайт хочу пожелать не откладывать проблему, здесь работают настоящие специалисты, доверяйте им. ";s:4:"TYPE";s:4:"HTML";}s:25:"PROPERTY_MESSAGE_VALUE_ID";s:8:"23506:24";s:19:"PROPERTY_FILE_VALUE";a:0:{}s:17:"PROPERTY_PD_VALUE";s:1:"1";s:20:"PROPERTY_PD_VALUE_ID";s:8:"23506:26";s:24:"PROPERTY_LAST_NAME_VALUE";N;s:27:"PROPERTY_LAST_NAME_VALUE_ID";s:9:"23506:115";s:27:"PROPERTY_IS_MODERATED_VALUE";s:1:"1";s:30:"PROPERTY_IS_MODERATED_VALUE_ID";s:9:"23506:139";s:25:"PROPERTY_SHOW_ON_EN_VALUE";N;s:28:"PROPERTY_SHOW_ON_EN_VALUE_ID";s:9:"23506:612";s:25:"PROPERTY_FILE_DESCRIPTION";a:0:{}s:31:"PROPERTY_FILE_PROPERTY_VALUE_ID";a:0:{}s:10:"specialist";b:0;s:4:"file";a:0:{}}i:23443;a:24:{s:2:"ID";s:5:"23443";s:11:"ACTIVE_FROM";s:22:"13 декабря 2013";s:9:"IBLOCK_ID";s:2:"12";s:19:"PROPERTY_NAME_VALUE";s:16:"Светлана";s:22:"PROPERTY_NAME_VALUE_ID";s:8:"23443:21";s:20:"PROPERTY_EMAIL_VALUE";s:17:"lana_sh73@mail.ru";s:23:"PROPERTY_EMAIL_VALUE_ID";s:8:"23443:22";s:25:"PROPERTY_SPECIALIST_VALUE";s:0:"";s:28:"PROPERTY_SPECIALIST_VALUE_ID";s:8:"23443:23";s:22:"PROPERTY_MESSAGE_VALUE";a:2:{s:4:"TEXT";s:883:"Мы с мужем говорим БОЛЬШОЕ,ОГРОМНОЕ СПАСИБО Меньшиковой Ирине Львовне!!! 19 августа 2013 у нас родилась долгожданная, замечательная, любимая доченька! На следующей неделе нам уже 4 месяца. Счастью нет предела! Результат с первой попытки! С наступающими Вас Новогодними праздниками, всего Вам самого н